import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"
import "slick-carousel/slick/slick-theme.css"
import Slide01 from '../Assestes/slider01.jpg'
import Slide02 from '../Assestes/slider02.jpg'
import Slide03 from '../Assestes/slider03.jpg'
function SliderMain(){
    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
      };
    return(
        <>
        <Slider className="slider" {...settings}>
            <img src={Slide01} alt="slide01" />
            <img src={Slide02} alt="slide02" />
            <img src={Slide03} alt="slide03" />
        </Slider>
        </>
    )
}

export default SliderMain;
